import React, { Component } from "react";
import classes from "./table.module.css";
import { connect } from "react-redux";
import Show from "../show/show";
class Table extends Component {
  state = {
    list: [
      {
        title: "Learning java",
        author: "siddhant",
        length: "20",
        category: "java",
      },
      {
        title: "Learning python",
        author: "siddhant",
        length: "20",
        category: "java",
      },
      {
        title: "Learning Ruby",
        author: "siddhant",
        length: "20",
        category: "java",
      },
      {
        title: "Learning react",
        author: "siddhant",
        length: "20",
        category: "java",
      },
      {
        title: "Learning english",
        author: "siddhant",
        length: "20",
        category: "java",
      },
    ],
  };

  render() {
    let value = this.state.list.map((ele) => {
      const d1 = Object.values(ele);
      return <Show data={d1} />;
    });
    let value1 = this.props.data.map((ele) => {
      const d1 = Object.values(ele);
      return <Show data={ele} />;
    });

    return (
      <div>
        {value}
        {value1}
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  const d1 = Object.entries(state);
  const d2 = d1
    .filter((ele) => {
      return ele[0] !== "count";
    })
    .map((ele) => ele[1]);
  return {
    data: d2,
  };
};

export default connect(mapStateToProps)(Table);
